f': 'https://api.github.com/repos/Azure/azure-sdk-for-java/pulls/comments/853708484'}, 'html': {'href': 'https://github.com/Azure/azure-sdk-for-java/pull/28296#discussion_r853708484'}, 'pull_request': {'href': 'https://api.github.com/repos/Azure/azure-sdk-for-java/pulls/28296'}}, 'reactions': {'url': 'https://api.github.com/repos/Azure/azure-sdk-for-java/pulls/comments/853708484/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'start_line': None, 'original_start_line': None, 'start_side': None, 'line': 181, 'original_line': 181, 'side': 'RIGHT'}, 'pull_request': {'url': 'https://api.github.com/repos/Azure/azure-sdk-for-java/pulls/28296', 'id': 909358363, 'node_id': 'PR_kwDOACyxNM42M7Ub', 'html_url': 'https://github.com/Azure/azure-sdk-for-java/pull/28296', 'diff_url': 'https://github.com/Azure/azure-sdk-for-java/pull/28296.diff', 'patch_url': 'https://github.com/Azure/azure-sdk-for-java/pull/28296.patch', 'issue_url': 'https://api.github.com/repos/Azure/azure-sdk-for-java/issues/28296', 'number': 28296, 'state': 'open', 'locked': False, 'title': 'AsyncCacheNonBlocking - Improve availability during replica movement', 'user': {'login': 'aayush3011', 'id': 14010132, 'node_id': 'MDQ6VXNlcjE0MDEwMTMy', 'avatar_url': 'https://avatars.githubusercontent.com/u/14010132?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/aayush3011', 'html_url': 'https://github.com/aayush3011', 'followers_url': 'https://api.github.com/users/aayush3011/followers', 'following_url': 'https://api.github.com/users/aayush3011/following{/other_user}', 'gists_url': 'https://api.github.com/users/aayush3011/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/aayush3011/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/aayush3011/subscriptions', 'organizations_url': 'https://api.github.com/users/aayush3011/orgs', 'repos_url': 'https://api.github.com/users/aayush3011/repos', 'events_url': 'https://api.github.com/users/aayush3011/events{/privacy}', 'received_events_url': 'https://api.github.com/users/aayush3011/received_events', 'type': 'User', 'site_admin': False}, 'body': '# Description

The current AsyncCache on force refreshes removes the value. It then creates a new value and all incoming requests are stuck waiting for the new task to complete.

Issue
If a single replica moves only 1 of the 4 replica URIs is stale. The current async cache is blocking all requests until the value is updated. The 3 other replicas could be used to successfully complete requests.

Solution
AsyncCacheNonBlocking was created. This async cache does not block requests on refresh. It instead returns the stale value until the refresh is complete. Then the refresh value is used to update the cache. Any request using the forceRefresh to true will wait on the same refresh task.

