://api.github.com/repos/Azure/azure-sdk-for-java/issues/27270', 'number': 27270, 'state': 'open', 'locked': False, 'title': 'Added unique key policy support to spring data SDK', 'user': {'login': 'kushagraThapar', 'id': 14034156, 'node_id': 'MDQ6VXNlcjE0MDM0MTU2', 'avatar_url': 'https://avatars.githubusercontent.com/u/14034156?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/kushagraThapar', 'html_url': 'https://github.com/kushagraThapar', 'followers_url': 'https://api.github.com/users/kushagraThapar/followers', 'following_url': 'https://api.github.com/users/kushagraThapar/following{/other_user}', 'gists_url': 'https://api.github.com/users/kushagraThapar/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/kushagraThapar/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/kushagraThapar/subscriptions', 'organizations_url': 'https://api.github.com/users/kushagraThapar/orgs', 'repos_url': 'https://api.github.com/users/kushagraThapar/repos', 'events_url': 'https://api.github.com/users/kushagraThapar/events{/privacy}', 'received_events_url': 'https://api.github.com/users/kushagraThapar/received_events', 'type': 'User', 'site_admin': False}, 'body': '# Description

* Closes https://github.com/Azure/azure-sdk-for-java/issues/15928
* Added unique key policy support to spring data SDK

* How customers will use it -> 
```
@Container
@CosmosUniqueKeyPolicy(uniqueKeys = {
    @CosmosUniqueKey(paths = {"/lastName", "/zipCode"}),
    @CosmosUniqueKey(paths = {"/city"})
})
public class CosmosUniqueKeyPolicyCodeSnippet {

    @Id
    String id;

    @PartitionKey
    String firstName;

    String lastName;
    String zipCode;
    String city;
}
```

* How the annotations look like -> 

```
/**
 * Represents the unique key policy configuration for specifying uniqueness constraints on items in the container in the
 * Azure Cosmos DB service.
 */
@Persistent
@Inherited
@Retention(RetentionPolicy.RUNTIME)
@Target(ElementType.TYPE)
public @interface CosmosUniqueKeyPolicy {

    /**
     * Set of unique keys which enforce uniqueness constraint on items in the container
     * in the Azure Cosmos DB service.
     *
     * @return unique keys
     */
    CosmosUniqueKey[] uniqueKeys() default {};
}
```

```
/**
 * Represents a unique key on that enforces uniqueness constraint on items in the container in the Azure Cosmos DB
 * service.
 * <p>
 * 1) For containers, the value of partition key is implicitly a part of each unique key.
 * <p>
 * 2) Uniqueness constraint is also enforced for missing values.
 * <p>
 * For instance, if unique key policy defines a unique key with single property path, there could be only one item that
 * has missing value for this property.
 *
 * @see CosmosUniqueKeyPolicy
 */
@Persistent
@Inherited
@Retention(RetentionPolicy.RUNTIME)
@Target(ElementType.TYPE)
public @interface CosmosUniqueKey {

    /**
     * A set of paths which must be unique for each item in the Azure Cosmos DB service.
     * <p>
     * The paths to enforce uniqueness on. Each path is a rooted path of the unique property in the item, such as
     * "/name/first".
     *
     * @return unique paths
     */
    String[] paths() default {};
}
```

